import  Bankslice  from './slice/bank'
import { configureStore } from '@reduxjs/toolkit'
import  Prodactr  from './slice/prodactr'
export const store = configureStore({
reducer: {
Bank:Bankslice,
PordactReduser:Prodactr
},
})
